.fabut {
  width: 100%;
  height: 100%;
  background: #fff;
}
.left {
  width: 70%;
  height: 100%;
  float: left;
  overflow: hidden;
}

.zhu {
  border: 1px solid #000;
  cursor: move;
}
.zhu .right_bottom {
  width: 40px;
  height: 40px;
  position: relative;
  left: 100%;
  top: 100%;
  margin-left: -20px;
  margin-top: -20px;
  cursor: se-resize;
}
/* 左边窗口信息 */
.right {
  width: 29.8%;
  height: 100%;
  float: right;
  border-left: 1px solid #132987;
}
.right_header {
  /* 左边头部样式 */
  width: 100%;
  height: 30px;
  background: #e5e5e5;
  text-align: center;
  line-height: 30px;
  font-size: 15px;
}
.right_body {
  /* 左边主体样式 */
  width: 90%;
  padding-left: 5%;
}
.right_body > div {
  margin-top: 20px;
  width: 100%;
  overflow: hidden;
}
.chuang input {
  /* 名称样式 */
  float: right;
  width: 240px;
}
.wdata {
  /* 窗口信息样式 */
  float: left;
}
.wdatali {
  float: right;
  width: 120px;
  font-size: 15px;
  padding-left: 5px;
  margin-bottom: 10px;
}
.wdatali input {
  width: 100px;
  float: right;
}
/* 表格 */
.tab {
  width: 100%;
  border: 1px solid #000;
}
.tab th,
td {
  border: 1px solid #000;
  height: 20px;
  font-size: 15px;
}
.kongzhi > div {
  float: left;
  width: 25%;
  text-align: center;
  margin-left: 13%;
}
.kongzhi .kongzhi_jia {
  width: 30px;
  height: 30px;
  background: url("../../../assets/yingzhi/jia.png") no-repeat;
  overflow: hidden;
}
.kongzhi .kongzhi_jian {
  width: 30px;
  height: 30px;
  background: url("../../../assets/yingzhi/jian.png") no-repeat;
  overflow: hidden;
}
.kongzhi .kongzhi_shang {
  width: 30px;
  height: 30px;
  background: url("../../../assets/yingzhi/shang.png") no-repeat;
  overflow: hidden;
}
.kongzhi .kongzhi_xia {
  width: 30px;
  height: 30px;
  background: url("../../../assets/yingzhi/xia.png") no-repeat;
  overflow: hidden;
}
.kongzhi > div > input {
  opacity: 0;
  filter: alpha(Opacity=100);
}
